import React from "react";
import { Children } from "react";

function Table ({children}) {
    return (
        <table>
        <thead>
          <tr>
              <th>Location</th>
              <th>Amount</th>
              <th>Date</th>
              <th>Status</th>
          </tr>
        </thead>

        <tbody>
          <tr>
            <td>{Children}</td>
            {/* <td>props.bill</td>
            <td>props.date</td>
            <td>props.status</td> */}
          </tr>
        </tbody>
      </table>
    )
}

export default Table;
